const register = async (req,res) => {
    //console.log("Register EndPoint: ", req.body);
    const { name, email, username, password, question, secret } = req.body;

    // Validation 
    if(!name) { return res.json({error:"Name: is required!"}); }
    if(!username) { return res.json({error:"username: is required!"}); }
    if(!username || 6 <= username.length > 64 ) { return res.json({ error: "Username is required! and it should be betwwen 6 and 64 characters long"}); }
    if(!password || 6 <= password.length > 64 ) { return res.json({ error: "Password is required! and it should be betwwen 6 and 64 characters long"}); }
    if(!email) { return res.json({ error: "Email is required! "}); }
    if(!question) { return res.json({ error: "Question is required! "}); }
    if(!secret) { return res.json({ error: "Secret is required! "}); }

    const email_exist = await User.findOne({email});
    if(email_exist){ return res.json({ error: "Email is already register. Please reset your password or use a new email."}); }

    const hashPass = await hashPassword(password);

    const user = new User({name, password: hashPass, username ,email, question, secret});

    try{
        await user.save();
        //console.log('Register User: ', user);
        return res.json({ ok: true}); 
    }
    catch(err){
        console.log("User Registration failed: ", err);
        return res.json({ error: 'Error: unabled to save User. Try again '});
    }
}
