        //console.log(` post : ${ email } , ${ password }`); User.findByIdAndUpdate(req.body._id, req.body.data, {new:true});
        // Validation 
        const user = await User.findOneAndUpdate({email:email}, {ignored_6: Date.now() });
     
        if( !user || user.email !== email ){ return res.json({ error: "Login information is no correct. Please check your login and try again."}); }

        const matched = await comparePassword(password,user.password);
   
        if( !matched ) {
            return res.json({ error: "Login information is no correct. Please check your login and try again."}); 
        }

        //user
